import {Link} from 'react-router-dom';
import React, {Component} from 'react';

class Balance extends Component {
    constructor() {
        super();
        this.state= {
            balance: '',
        }
    };

    componentDidMount() {
        fetch('movements/api/balance/')
        .then(res => res.json())
        .then(data => {
          console.log(data);
          this.setState({
            balance:data
          })
        })
        .catch(console.log)
    };

    render() {
        return (
          <div className="container">
              <h2>Balance:</h2>
              
        </div>
        )};
};

export default Balance
